R["oh__@iola_stars"]="{['TS']=1719783318,['Version']=1773,['eu']={[25]={['D']='Small honey farm by a Nord with big (mead) dreams!',['C']=1.021000,['O']=19904,['N']='Honey Haven',},[23]={['D']='Between green-soaked Valenwood and sunburnt Elsweyr lies a trading post open only to those with adventure in their hearts.\\r\\nA place of in-betweens, where one can hear the echo of a story coming to its end.\\r\\nOr, the beginning of something; the first step of a tale waiting to be written. \\r\\nTread lightly and take only what calls to you. Rumours speak of eyes watching from the marsh. \\r\\nSafe onward travels, Stranger, and keep your eyes upon the path! \\r',['C']=1.026000,['O']=19446,['N']='The Last Baandari',},[11]={['D']='The cozy retreat of a wizard whose friends have dropped by unannounced to celebrate the New Life Festival. Luckily there is still one seat at the table to be filled, so please step inside, try not to trip into the star pool and enjoy an evening of excellent conversation and passable food!',['C']=1.500000,['O']=19713,['N']='Caer Gwydion',},[81]={['D']='An old crumbling shrine to Dibella hidden in the mountains of Skyrim. The journey to this old spring is long and has become more dangerous as the years past. Or perhaps Dibellan worship has just fallen out of favour in Skyrim. Regardless, the shrine is overgrown and abandoned, just waiting for a new purpose...',['C']=1.026000,['O']=19864,['N']='Wellspring',},[37]={['D']='Plant Shop, Cafe and Gardens. Please keep to the paths and enjoy your visit!',['C']=1.021000,['O']=19632,['N']='March Gardens',},[14]={['D']='A spirit once called this place home, you can feel their power echoing through the stone.\\nPerhaps they will do so again, when the time is right and harmony restored.\\nUntil then I will make my home above the rock, amongst the trees, and wait.',['C']=1.031000,['O']=19364,['N']='Shrine to the Green',},[71]={['D']='\\'Welcome back to the Reconvergence.\\r\\nI know, you don’t remember.\\r\\nYour soul was once torn from your body, you were a Vestige.\\r\\nNow there is choice, not death.\\r\\nTo return to your body, go back through the flame. Your memories will follow.\\r\\nOr choose the door that resonates with your soul, begin again.\\r\\nOr you may follow the river until it’s end and choose true Rebirth.\\r\\'\\n(Or, life after the main quest, our reliance on soul gems and what happens if a soul gets lost.) ',['C']=1.020000,['O']=19491,['N']='The Reconvergence',},},['Key']='oh__@iola_stars',}"
