a',['message']='What you see here is but a mere fraction of my realm, for the sheer length and breadth of Apocrypha would shatter the mortal mind to pieces.',},['Z']=83375,['Id']=1118,['Color']=999998,['SizeZ']=260,['Groups']=0,['Yaw']=1.570796,},[79]={['Y']=9370,['EffectType']=5067,['Alpha']=1,['SizeY']=260,['Roll']=0,['Contrast']=1,['SizeX']=106.935484,['Pitch']=0,['X']=78553,['MetaData']={['name']='Hermaeus Mora',['message']='The infinite abyssal sea beyond these walls contain innumerable island libraries... Unending knowledge.. though many of the most... amusing tomes.. remain here in my keeping.',},['Z']=87937,['Id']=1119,['Color']=999998,['SizeZ']=260,['Groups']=0,['Yaw']=3.141593,},[80]={['SizeZ']=500,['SizeY']=1,['EffectType']=7,['Roll']=0,['Contrast']=1.330000,['Y']=11394,['SizeX']=500,['X']=81189,['Z']=75027,['Color']=569937,['Id']=1120,['Pitch']=1.570971,['Alpha']=1,['Groups']=0,['Yaw']=4.712389,},[81]={['SizeZ']=700,['SizeY']=700,['EffectType']=25,['Roll']=0,['Contrast']=1.570000,['Y']=11395,['SizeX']=700,['X']=81207,['Z']=75030,['Color']=170001,['Id']=1121,['Pitch']=0,['Alpha']=0.940000,['Groups']=0,['Yaw']=4.712389,},[82]={['SizeZ']=300,['SizeY']=300,['EffectType']=926,['Roll']=0,['Contrast']=1,['Y']=13597,['SizeX']=220,['X']=81584,['Z']=81508,['Color']=494948,['Id']=1122,['Pitch']=0,['Alpha']=1,['Groups']=0,['Yaw']=3.141593,},[83]={['SizeZ']=300,['SizeY']=300,['EffectType']=926,['Roll']=0,['Contrast']=1,['Y']=13597,['SizeX']=220,['X']=81622,['Z']=78946,['Color']=494948,['Id']=1123,['Pitch']=0,['Alpha']=1,['Groups']=0,['Yaw']=3.141593,},[84]={['SizeZ']=300,['SizeY']=300,['EffectType']=926,['Roll']=0,['Contrast']=1,['Y']=13597,['SizeX']=220,['X']=75594,['Z']=81483,['Color']=494948,['Id']=1124,['Pitch']=0,['Alpha']=1,['Groups']=0,['Yaw']=3.141593,},[85]={['Y']=11761,['EffectType']=116,['Alpha']=0.700000,['SizeY']=427,['Roll']=0,['Contrast']=0.590000,['SizeX']=460,['Pitch']=0,['X']=77716,['MetaData']={},['Z']=77317,['Id']=1125,['Color']=337699,['SizeZ']=427,['Groups']=0,['Yaw']=3.141593,},[86]={['Y']=11632,['EffectType']=872,['Alpha']=1,['SizeY']=48,['Roll']=0,['Contrast']=1,['SizeX']=49,['Pitch']=0,['X']=77712,['MetaData']={['message']='Candlelit Lectern',},['Z']=77241,['Id']=1126,['Color']=9998,['SizeZ']=48,['Groups']=0,['Yaw']=3.141593,},[87]={['Y']=11540,['EffectType']=8502,['Alpha']=1,['SizeY']=45,['Roll']=0,['Contrast']=1,['SizeX']=38.456456,['Pitch']=5.085889,['X']=77713.998437,['MetaData']={['title']='-LEFT CLICK TO READ-',['message']='Dear Essential Housing Community Guests, \\n\\nMy name is Agonisus, and I would like to take a few moments to personally welcome you to one of my humble housing abodes. \\n\\nI invest a great deal of time, creativity and resources into all of my thematic housing projects. I can only hope that my efforts inspire a sense of awe and wonder in each guest who graces my home with their visit.\\n\\nMy intent was to create a fully immersive community role-playing venue in the very heart of Apocrypha. If you are the GM of an ESO RP Guild, feel free to lead your troupe on an IC expedition into the Golden Eye\\'s realm. \\n\\nIf ever you seek the most powerful, destructive or outright forbidden esoteric knowledge to use as a plot-device for your guild\\'s story, this is the venue where your characters will find it!\\n\\n\\n\\nPlease bear in mind that this player home was built years before Necrom was released. Obviously Apocrypha is now an actual zone in Elder Scrolls Online, and sadly, I suspect few players will come here anymore.\\n\\nHowever, now that Necrom is released, I have since revised the Athenaeum to include some newer Apocrypha furnishings that did not previously exist. I hope my community friends and fellow housing aficionados will enjoy these updated changes as much as I do! \\n\\nIf some of you do happen upon my beloved role-playing venue, please sign the guestbook to show your support for player contributed community art and passionate creativity. \\n\\nMay your love of adventure never fade!\\n\\nRespectfully,\\n@Agonisus ',},['Z']=77197.999777,['Id']=1127,['Color']=102439,['SizeZ']=45,['Groups']=0,['Yaw']=3.141593,},[88]={['Y']=11684,['EffectType']=8502,['Alpha']=1,['SizeY']=45,['Roll']=0,['Contrast']=1,['SizeX']=38.456456,['Pitch']=5.131268,['X']=78684.606244,['MetaData']={['title']='LEFT CLICK TO READ',['message']='Dear Essential Housing Community Guests, \\n\\nMy name is Agonisus, and I would like to take a few moments to personally welcome you to one of my humble housing abodes. \\n\\nI invest a great deal of time, creativity and resources into all of my thematic housing projects. I can only hope that my efforts inspire a sense of awe and wonder in each guest who graces my home with their visit.\\n\\nMy intent was to create a fully immersive community role-playing venue in the very heart of Apocrypha. If you are the GM of an ESO RP Guild, feel free to lead your troupe on an IC expedition into the Golden Eye\\'s realm. \\n\\nIf ever you seek the most powerful, destructive or outright forbidden esoteric knowledge to use as a plot-device for your guild\\'s story, this is the venue where your characters will find it!\\n\\n\\n\\nPlease bear in mind that this player home was built years before Necrom was released. Obviously Apocrypha is now an actual zone in Elder Scrolls Online, and sadly, I suspect few players will come here anymore.\\n\\nHowever, now that Necrom is released, I have since revised the Athenaeum to include some newer Apocrypha furnishings that did not previously exist. I hope my community friends and fellow housing aficionados will enjoy these updated changes as much as I do! \\n\\nIf some of you do happen upon my beloved role-playing venue, please sign the guestbook to show your support for player contributed community art and passionate creativity. \\n\\nMay your love of adventure never fade!\\n\\nRespectfully,\\n@Agonisus ',},['Z']=92246.956669,['Id']=1128,['Color']=102439,['SizeZ']=45,['Groups']=0,['Yaw']=6.25875