']=5929,['Yaw']=4.712389,['Pitch']=1.570971,['Y']=18644,['EffectType']=910,['Roll']=0,},[69]={['Groups']=0,['Contrast']=1,['Id']=1272,['X']=43644,['SizeZ']=22,['Alpha']=1,['Color']=999998,['EffectType']=5064,['SizeY']=22,['Pitch']=0,['Z']=4228,['Yaw']=4.712389,['Y']=19283,['SizeX']=273.137255,['MetaData']={['message']='Who\\'ve the crows led in from the Rift now, hmm? An adventurer? There\\'ve been so few visitors of late, what with most folks flirtin\\' like a buncha ninnies at the Bee and Barb...  But enough of that! Welcome to the Foyer, dear! The Hunt-Father awaits ya! That is, if you\\'re brave enough to seek his favor?',['name']='Sister Gellenna',},['Roll']=0,},[70]={['Groups']=0,['Contrast']=1,['Id']=1273,['SizeZ']=500,['Alpha']=1,['SizeY']=500,['X']=43635,['Color']=996948,['SizeX']=500,['Z']=4271,['Yaw']=3.141593,['Pitch']=0,['Y']=19505,['EffectType']=972,['Roll']=0,},[71]={['Groups']=0,['Contrast']=1,['Id']=1274,['X']=43405.041936,['SizeZ']=30,['Alpha']=1,['Color']=102439,['EffectType']=8502,['SizeY']=30,['Pitch']=4.799655,['Z']=4285.812390,['Yaw']=5.888741,['Y']=19417,['SizeX']=26.456456,['MetaData']={['title']='-LEFT CLICK TO READ-',['message']='Dear Essential Housing Community Guests, \\n\\nMy name is Agonisus, and I would like to take a few moments to personally welcome you to one of my humble housing abodes. \\n\\nI invest a great deal of time, creativity and resources into all of my thematic housing projects. I can only hope that my efforts inspire a sense of awe and wonder in each guest who graces my home with their visit.\\n\\nMy intent was to create a fully immersive community role-playing venue in the form of primitive hunting village in Hircine\\'s realm of Oblivion; the legendary Hunting Grounds. \\n\\nIt is from here his hounds stalk the deadliest prey ever to walk the face of Nirn, or the realms beyond.  Defensible cliffs overlook the dark, forested landscape below and fortified camps afford noble hunters the ability to congregate, and engage in ritual worship in reverence to the Master of the Chase. \\n\\nA monolithic standing stonehenge communes the will of Lord Hircine, and it is through this circle of power that the worthy are bestowed his boon. Are you brave enough to earn your place among the great Hounds of Hircine?\\n\\nI will never moderate or disrupt your role-play activities. However. If I\\'m ever present during your visit, I may be inclined to role-play if you initiate contact with me in character. <3\\n\\nIf you experience role-play griefing from a random visitor, please mail their @account name to me so I can ban them accordingly. I\\'m online often and will happily intervene.\\n\\nI wish you well in your adventures and hope to see you visit soon. Please sign the guest book to show your support for my work?\\n\\nRespectfully,\\n-Agonisus',},['Roll']=0,},[72]={['Groups']=0,['Contrast']=1,['Id']=1275,['X']=43405.133444,['SizeZ']=22,['Alpha']=1,['Color']=9998,['EffectType']=872,['SizeY']=22,['Pitch']=0,['Z']=4286.043264,['Yaw']=4.450590,['Y']=19446,['SizeX']=20,['MetaData']={['message']='A Note from the Creator',},['Roll']=0,},[73]={['Groups']=0,['Contrast']=1,['Id']=1276,['SizeZ']=1000,['Alpha']=0.880000,['SizeY']=1000,['X']=46598.158226,['Color']=435999,['SizeX']=1000,['Z']=6872.970837,['Yaw']=3.141593,['Pitch']=0,['Y']=16078,['EffectType']=499,['Roll']=0,},[74]={['Groups']=0,['Contrast']=1,['Id']=1277,['SizeZ']=1000,['Alpha']=0.880000,['SizeY']=1000,['X']=46598.158226,['Color']=435999,['SizeX']=1000,['Z']=6872.970837,['Yaw']=3.141593,['Pitch']=0,['Y']=16478,['EffectType']=499,['Roll']=0,},[75]={['Groups']=0,['Contrast']=1,['Id']=1278,['SizeZ']=1000,['Alpha']=0.880000,['SizeY']=1000,['X']=46598.158226,['Color']=435999,['SizeX']=1000,['Z']=6872.970837,['Yaw']=3.141593,['Pitch']=0,['Y']=16878,['EffectType']=499,['Roll']=0,},[76]={['Groups']=0,['Contrast']=0.170000,['Id']=1279,['SizeZ']=2100,['Alpha']=0.320000,['SizeY']=2100,['X']=46857.994325,['Color']=517399,['SizeX']=1850,['Z']=7110.594534,