R["oh__@magena2020"]="{['Key']='oh__@magena2020',['Version']=1773,['na']={[81]={['O']=19021,['C']=1.002000,['D']='Winter Retreats (Spicy Life non contest event).  Prince Irnskar winter retreat in Western Skyrim as he waits to take over for his father Jorunn the Sklad King. A place to study and even dabble in some magic in the Mage tower overl looking the lodge. Please enjoy and dont forget to grab a mead at the lodge tavern! ',['N']='Hjaalmarch Gallery',},[70]={['O']=18896,['C']=1.021000,['D']='Khajiit inspired terrace gardens. Be sure to hike down to the base of the waterfall to the temple cottage to pray to the RNG gods!! Thank you for visiting!',['N']='Rimmen Temple',},[23]={['O']=19077,['C']=1.002000,['D']='Spicy guild Khajiit inspired rooms! ',['N']='Rawl\\'kha House',},[75]={['O']=19060,['C']=1.037000,['D']='Forgemaster Falls, Cathedral by the Sea. CrazyVogue\\'s Holy Housing Contest. ',['N']='Wrothgar Village',},[41]={['C']=1.020000,['O']=19866,['D']='Enchanted Grove retreats contest: Backstory:\\r\\nThis is a story of a princess who loved her castle and gardens. One day she went to battle, sadly not to return. The townspeople kept up the castle and small memorial in her honor. As the years went by they also noticed a great tree growing behind the castle and they wondered if in some small way the princess had returned….but you can be the judge of how the story ends. Please enjoy a stroll through the town and gardens. \\r\\n',['N']='Craglorn Estate',},[90]={['O']=19007,['C']=1.002000,['D']='Lyranth\\'s Castle- Built for OMP contest. Enjoyment for Daedric and commonfolk!',['N']='Deadlands Plot',},[91]={['O']=18958,['C']=1.002000,['D']='Thankfulness Housing Event. Mall, Theater, and Gardens! Enjoy!',['N']='Aqueduct Villa',},[94]={['O']=19188,['C']=1.012000,['D']='Enjoy the Aquarium castle below the sea along with Psijic quarters. Above the surface keep a look out for a pirate hideout. Yar! ',['N']='Coral Atoll',},[10]={['O']=19171,['C']=1.002000,['D']='Antiquity x Infinity contest (sponser: Jhart Ellis) Use multiple of the antiquity furnishings now that you can buy them from vendors if you have 3 of the codex! Enjoy!\\n',['N']='Dhalmora House',},[30]={['C']=1.020000,['O']=19815,['D']='Overgrown Druid Hide-Away. The druid Ryvana has been working her magic to create a secret garden. Please enjoy!',['N']='Riften House',},[9]={['O']=19279,['C']=1.002000,['D']='Beautiful Breton Homes (sponser- JHart) Build using High Isle materials and furniture. (recently updated) Story: Druid Ryvana and Ember are visting Auridon to study the flora and fauna, also to teach Tales of Tribute to the locals. Please stop by for a visit! ',['N']='Mathiisen House',},},['TS']=1716482222,}"
