R["oh__@mloking"]="{['TS']=1716306233,['Version']=1773,['eu']={[32]={['D']='Makes-Many-Soups was tired of not being placed in a house yet so she decided to start her own business called \\'Warm-Soup Wagon Pub\\' that travels from town to town serving citizens of Tamriel fresh and tasty soups and stews!',['N']='Warm-Soups Wagon Pub',['O']=19769,['C']=1.024000,},[33]={['D']='Chapel dedicated to one of the eight Divines.. Small peaceful graveyard next to and an underground crypt inside the chapel..',['N']='Chapel of Akatosh',['O']=19174,['C']=1.037000,},[34]={['D']='An alchemists hut for growing special plants and selling flowers and potions right there for people who visit :)',['N']='Alchemy Hut',['O']=19067,['C']=1.021000,},[35]={['D']='Would your ideal Christmas be in a cabin, in the middle of the woods, during a blizzard, while sitting warm and cosy in front of a fireplace, drinking a hot beverage? If yes, then you\\'re (hopefully) at the right place!',['N']='Holiday Cabin',['O']=19713,['C']=1.036000,},[5]={['D']='Altar dedicated to the purest and chubbiest animal in Tamriel, the one and only, Guar.',['N']='Guar Altar',['O']=19260,['C']=1.037000,},[38]={['D']='City of Future and Nature\\r\\nWhen someone says future, lot of people think of something futuristic to us, either cosmic, flying cars, robots for everything, etc... I tried building something people of Tamriel would imagine as a future, where steam powered technology lives in harmony with nature. But where does the energy come from? The slightly disturbing answer is hiding in the heart of this town...',['N']='Future & Nature City',['O']=19680,['C']=1.041000,},[71]={['D']='Hanging Gardens of Babylon\\r\\nWelcome to my interpretation of \"Hanging Gardens\" situated in streets of Babylon. Middle floor of the gardens is accessible with stairs on the left. Enjoy your visit and please don\\'t jump over the terrain or swim in water (there won\\'t be anything interesting even on the roofs) thank you!',['N']='Hanging Gardens',['O']=19379,['C']=1.021000,},[9]={['D']='A classic Jewish-Czech folklore, a Golem created to protect the jewish ghetto. Golem is powered by a special scroll and will listen to whom inserts it. Golem was once overwhelmed with power from having the scroll active for too long and begun to destroy anything that crossed it\\'s path..',['N']='The Golem of Prague',['O']=19651,['C']=1.019000,},[10]={['D']='Be careful stepping into these mines..',['N']='Abandoned Mine',['O']=19067,['C']=1.038000,},[43]={['D']='Thil Mora (Brick Forest) is a new village in Vvardenfell built next to lake Amaya.. Welcomes everyone who is in need of a shelter :\\')',['N']='Thil Mora',['O']=19075,['C']=1.041000,},[12]={['D']='A wizard\\'s tower with a ritualist twist.',['N']='Scarlet Tower ',['O']=19722,['C']=1.020000,},[13]={['D']='A small shrine dedicated to St. Kaladas, founder of the chapel of Zenithar in Leyawiin..',['N']='St. Kaladas Shrine',['O']=19067,['C']=1.037000,},[16]={['D']=':o',['N']='Sacrificial Chamber',['O']=19076,['C']=1.023000,},[49]={['D']='A cute little treehouse on a hill :3',['N']='Treehouse Hill',['O']=19673,['C']=1.031000,},[105]={['D']='Guardian\\'s Grotto - Last known druidic town in east Skyrim, living peacefully under the protection of the druidic spirit - the Guardian.',['N']='Guardian\\'s Grotto',['O']=19864,['C']=1.020000,},[19]={['D']='A little town for my shroom shalk collection :3',['N']='Shroom Shalk Town',['O']=19264,['C']=1.041000,},[7]={['D']='An Elsweyr street market waiting for the right merchants!',['N']='Street Market',['O']=19067,['C']=1.041000,},[21]={['D']='This Dres settlement is used as a resting point for slave transport between Mournhold and Ebonheart. House Dres\\' income isn\\'t only from slavery haggling, but also from saltrice export, which goes hand in hand. An altar for daedric worship is a common appearance in Dres culture. You can find one hidden \"Where the guars rest\" (*in the stables*).',['N']='Dres Settlement ',['O']=19685,['C']=1.026000,},[22]={['D']='Cozy little breton bakery for one of my characters - Mercer Jeanard :3',['N']='Jeanard\\'s Bakery',['O']=19120,['C']=1.024000,},[37]={['D']='The Oaken Hideout \\r(Treehouse)\\nOn the edge of Valenwood forest, an adventurous warden found an abandoned treehouse sitting on a majestic oak just below the springs of river S’ren-ja. With help of Khajiit and Bosmer folk living nearby, the house was quickly restored into something magical and cosy, a hideout every warden is dreaming of. River provides fresh food and magical forest supplies alchemical reagents.\\r',['N']='The Oaken Hideout',['O']=19497,['C']=1.031000,},[88]={['D']='',['N']='Leyawiin Bridge Home',['O']=19068,['C']=1.051000,},[26]={['D']='Last living Falmers were captured by dwarven automatons...',['N']='Blackreach Depths ',['O']=19477,['C']=1.043000,},[90]={['D']='A tower inspired by Elder Scrolls IV: Oblivion.. guarding the greatest sigil stone in the planes of oblivion..',['N']='Sigil Keep',['O']=19117,['C']=1.043000,},[11]={['D']='Alinor/markarth style house with a romantic pond and relaxing garden area   :3',['N']='Arientte Estate',['O']=19105,['C']=1.021000,},[28]={['D']='A small tavern for travellers in The Rift.. Looking for a bard :\\'D',['N']='Bard\\'s Inn',['O']=19366,['C']=1.041000,},[29]={['D']='One of the clockwork Precursors was tired of being a dummy.. Influenced by the environment he spent his whole life in, he decided to grow flowers by himself in his own little shop..\\nTip: Not recommended to throw them at your wedding.',['N']='Clockwork Flowershop',['O']=19135,['C']=1.002000,},[3]={['D']='One of the most beatiful creatures to live in Tamriel found it\\'s nesting inside Ebonheart! They require very specific environment to lay eggs as for example Culanda stones and the finest golden flowers and leaves.',['N']='Quasigriff Nest',['O']=19193,['C']=1.019000,},[95]={['D']='The seemingly cute creature is in fact very dangerous.. Be careful exploring the lair..',['N']='Broken Vessel Grotto',['O']=19180,['C']=1.019000,},},['Key']='oh__@mloking',}"
