R["oh__@agonisus"]="{['Key']='oh__@agonisus',['TS']=1709264452,['na']={[72]={['C']=1.007000,['D']='An immersive open community role-playing venue set in Hermaeus Mora\\'s realm of Apocrypha. This humble player home was constructed years before the Necrom DLC was released, so please do bear that in mind as you walk (not run) through these long forgotten halls of scholarly academia. I have taken the liberty to update the venue with a little post-Necrom furnishing content and music, but it remains mostly as I originally designed it. Please sign my guest book to show your support? <3',['O']=19783,['N']='The Athenaeum',},[61]={['C']=1.007000,['D']='A meticulously decorated open community role-playing venue set in a tribal village located in the heart of Hircine\\'s Hunting Grounds.\\r I have invested a great deal of time, creativity, crafting materials, gold and real-world money to build unique houses such as this one.\\r I highly recommend that you walk (not run) around\\r all areas of the home and truly immerse yourself for the intended experience. Streamers are welcome! Please sign the guest book to show your support for my work!',['O']=18909,['N']='The Bloodmoon Caern',},[66]={['C']=1.001000,['D']='A very fun, addictive PvE melee focused training arena with interactive traps and *extra traps* to add to the difficulty. The goal is to eliminate the target dummy and survive in close quarter combat. There is also plenty of food, ale and seating for spectators! Please sign the guest book to show your support for my work!',['O']=18909,['N']='The Circle of Blades',},},['Version']=1773,}"
