R["oh__@svart_815"]="{['eu']={[32]={['C']=1.041000,['N']='Sensford\\'s FG',['O']=18818,},[35]={['C']=1.029000,['N']='Ancestral Tomb',['O']=18749,},[36]={['O']=18823,['C']=1.035000,['N']='Streets of Belotte',['D']='Resort town on small island between Summerset and Auridon. Altmeri always rest here and sunbath on golden sand. And famous elven navals protects this area from maormers. ​After Queen\\'s Decree many travelers can aknow local culture and buy souvenirs.\\r\\nThis is head-canoned Belport from TES:Arena and can differ from LORE.\\r\\nOpen for RP!',},[37]={['O']=19734,['C']=1.007000,['N']='Qa\\'Tasha-daro manor',['D']='The manor house made by akaviri style. Clanmother uses it for resting between travels, also for meetings and events.\\r\\n\\r\\nThis is the part of totality my Khajiit-themed houses, see also Halls of Lunar Champion and Dawnshadow',},[38]={['O']=18823,['C']=1.041000,['N']='Streets of Gradkeep',['D']='Breton town of Reich Gradkeep from TES:Arena and Daggerfall. It\\'s head-canoned and may differ from other players\\' views. \\r\\nOpen for RP! Have connection with \"Stone Sword\" tavern (Garnder House).',},[10]={['C']=1.037000,['N']='Boethia\\'s Shrine',['O']=18749,},[11]={['C']=1.021000,['N']='Eliseum Tharcyro',['O']=18749,},[13]={['N']='Telvanni housepod',['O']=18411,},[15]={['O']=18903,['C']=1.041000,['N']='Hectalcharya Village',['D']='Once this village in Valenwood was founded by Altmeri miners. They excavated magic crystals but then Force of Nature drove them out. Soon bosmers settled in abandoned houses and protects the crystals, bacause they feed the Green with power.\\r\\nOpen for RP.',},[49]={['N']='Ald-Garlas-Hame',['O']=18638,},[18]={['O']=18823,['C']=1.007000,['N']='\"Stone Sword\" Tavern',['D']='\"Stone Sword\" tavern in Reich Gradkeep named like this for statue that stand on a square nearby. There is free of politics and welcome to foreighers, so any travelers can stay here and taste local beer.\\r\\nOpen for RP!',},[19]={['N']='Telvanni ?hambers',['O']=18411,},[20]={['C']=1.020000,['N']='Telvanni house',['O']=18749,},[23]={['C']=1.007000,['N']='\"Ears and Paws\" Cafe',['O']=18749,},[24]={['O']=19734,['C']=1.007000,['N']='\"Not last stop\" tvrn',['D']='The tavern inspired by Akaviri style in the Baandari Tradepost. Take a seat, eat. Rest. This is not last stop. It\\'s not time. The road is long and full of adventures.\\r\\n\\r\\nThis is the part of totality my Khajiit-themed houses, see also Halls of Lunar Champion and Serenity Falls\\r\\n\\r\\n',},[26]={['C']=1.007000,['N']='Wasten-Veyond',['O']=18782,},[59]={['O']=18823,['C']=1.007000,['N']='\"Wilin Fanac\" Club',['D']='“White Bird” in Altmeris. This is a club for nobles in Shimmerene that has been operating since 2E 480. Visitors can meet here, eat delicacies, play games, dance and walk in the garden.\\r\\nThere are some rules:\\r\\n-Observe the dress code, armor and weapons are not allowed;\\r\\n-Don’t quarrel and don’t fight on the club territory;\\r\\n-Don’t break the property of the club and don’t insult servants;\\r\\n-Lower castes, Apraxics and foreigners not welcomed here.\\r\\nOpen for RP if you have altmer char',},[62]={['O']=18925,['C']=1.017000,['N']='Telin Tharcyro',['D']='The elder castle north of Shimmerene on the cliffs near King\\'s Haven Pass. This castle was founded in Dawn Era for protecting Direnni\\'s lands from goblins and monsters. Altmeri House Tharcyro rules this castle and surrounding villages for ages and serves honesty to Kinhouse of Shimmerene.\\n(All content inside villa, you can also use outfit station in light place)',},[70]={['O']=19734,['C']=1.041000,['N']='Baandari Tradepost',['D']='A fortified place on a road somewhere in Elsweyr settled by Baandari pedlars and turned into savety tradepost\\r\\n\\r\\nThis is the part of totality my Khajiit-themed houses, see also Halls of Lunar Champiand Serenity Falls\\r\\n\\r\\n',},},['TS']=1705066832,['Version']=1773,['Key']='oh__@svart_815',}"
