R["oh__@aleris_1988"]="{['TS']=1698961034,['eu']={[43]={['C']=1.021000,['D']='',['O']=19553,['N']='Hlaalu Home',},[49]={['D']='The Wicked Witch\\'s hut, directly from The Witcher 3! :)',['C']=1.038000,['O']=19663,['N']='Witches Hut',},[75]={['C']=1.041000,['D']='An Orc trading post where all races can gather peacefully. You are welcome to explore the main market area or lose yourself in the Khajiit nearby village, but beware of the ogre that might be lurking nearby! Or just head to the lake on the hill and pay your respects to the almighty Sithis. Hail Sithis!\\r\\nPS. Don’t forget to sign my guest journal! Many Thanks. Aleris\\r\\n',['O']=19567,['N']='Wrothgar Trade Post',},[99]={['C']=1.015000,['D']='\\'The Heart of the Dragon\\' is a mighty vessel, whose destiny it is to transport all kinds of wares over the seven seas. With Captain Aron Kain on the helm, this gigantic bastion of a ship parts the waves as she makes her way to her next destination, armed to the teeth with ballistas, her own sickbay, and the subliminally furnished captains quarters. Depending on where the journey leads, the crew sails in company of a harrowing creature, lurking underneath the main deck.\\nDecorated by: @Vnx ',['O']=19588,['N']='Heart of the Dragon',},},['Version']=1773,['Key']='oh__@aleris_1988',}"
