R["gb__eu__@tyrion_baenre__61"]="Stefan Plaza (@ThorGaleen),1698567151;Stabbitydoom (@StabbityDoom),1672365389;The Hermit (@Lilarna),1663752205;Elam-Drals (@Raziel_666),1663084425;Unktom Motierre (@Unktom),1662904545;Bis'hanti (@Mokkis77),1660755460;Shâla (@Lia_Nah),1660580454;Aria Amaris (@strike4),1660350693;Dieser-ist-lost (@inkedraven),1660342001;Shterion (@Shterion),1660323170;"
R["fx__eu__@kisakee__90"]="{['Effects']={[1]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=114017.292212,['Alpha']=1,['Pitch']=3.141767,['X']=71560.526921,['Contrast']=1,['Y']=52030,['SizeX']=26.456456,['Id']=1005,['Groups']=0,['Roll']=0,['MetaData']={['title']='Der Wolf und die Meisterbäckerin',['message']='Es war einmal vor langer Zeit, da zog ein einsamer Wolf durch die dunklen Wälder Tamriels. Eines Nachts näherte er sich einer kleinen Stadt, denn sein Magen knurrte ohne Unterlass und die Wälder waren karg und ohne Beute.\\n\\nDie Straßen waren leer, doch in einer kleinen Bäckerei brannte noch Licht und ein vertrockneter Süßkringel lag vor der Türschwelle. Verzweifelt verschlang der Wolf den Kringel, drohte er doch zu verhungern.\\n\\nDie Süßspeise mundete ihm köstlich und er kehrte Nacht um Nacht zurück, um sich die eine oder andere Naschware zu stibitzen. Bald schon verschmähte er jedes Getier des Waldes, waren doch die Süßkringel so wunderbar wohlmundend.\\n\\nEines Abends, der Wolf labte sich gerade an einem Stück hervorragender Torte, trat unerwartet die Bäckerin, Isobel, vor die Tür. Als sie den Wolf sah, erschrak sie sehr und jagte ihn wütend hinfort.\\n\\nFortan verriegelten die Stadtbewohner alle Tore aufs Genauste. Der Wolf, begierig auf Süßspeisen, versuchte sich bei den Bewohnern gut zu stellen. Er grüßte sie freundlich und brachte ihnen Geschenke, doch sie bewarfen ihn mit Tomaten. Er spielte mit ihren Kindern und beschützte sie vor den Gefahren des Waldes, doch die Städter sahen in ihm nur ein gieriges Ungeheuer.\\n\\nDa wusste sich der arme Wolf nicht mehr zu helfen und er überlegte sich einen schlauen Plan: Isobels Großmutter lebte tief im Wald und die Bäckerin brachte ihr regelmäßig etwas Wein und Kuchen. Wenn der Wolf nun den Platz der Großmutter einnähme, hätte er doch gewiss genügend Süßkringel auf Lebzeiten und müsste die Stadtbewohner nicht mehr bedrängen?\\n\\nSo verschlang der Wolf die Großmutter, legte sich in ihr Bettchen, deckte sich gut zu und wartete auf Isobel.',},['Yaw']=1.514946,['EffectType']=8502,},[2]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=113960.067745,['Alpha']=1,['Pitch']=3.141767,['X']=71568.901538,['Contrast']=1,['Y']=52030,['SizeX']=26.456456,['Id']=1006,['Groups']=0,['Roll']=0,['MetaData']={['title']='The Wolf and the Master Baker',['message']='Once upon a time, a lone wolf roamed the dark forests of Tamriel. One night he approached a small town, for his stomach was growling incessantly and the forests were barren and devoid of prey.\\n\\nThe streets were empty, but there was still light in a small bakery and an old sweetroll was lying on the doorstep. The wolf desperately devoured the sweetroll, as he was in danger of starving.\\n\\nHe enjoyed the delicious treat and returned night after night to steal one or two sweetrolls. He soon despised every creature in the forest, as the sweetrolls were so wonderfully tasty.\\n\\nOne evening, while the wolf was feasting on a piece of excellent cake, the baker, Isobel, unexpectedly came to the door. When she saw the wolf, she was very frightened and angrily chased him away.\\n\\nFrom then on, the townspeople locked all gates very carefully. The wolf, eager for sweets, tried to appease the residents. He greeted them warmly and brought them gifts, but they threw tomatoes at him. He played with their children and protected them from the dangers of the forest, but the townspeople saw him as nothing more than a greedy monster.\\n\\nThe poor wolf didn\\'t know what to do and came up with a clever plan: Isobel\\'s grandmother lived deep in the forest and the baker regularly brought her some wine and cake. If the wolf were to take the place of the grandmother, he would surely have enough sweetrolls for his needs and would no longer have to harass the townspeople?\\n\\nSo the wolf devoured the grandmother, laid down in her bed, covered himself in her blankets and waited patiently for Isobel\\'s delivery.\\n',},['Yaw']=1.514946,['EffectType']=8502,},[3]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=112191.265570,['Alpha']=1,['Pitch']=0,['X']=73806.705387,['Contrast']=1,['Y']=51816,['SizeX']=26.456456,['Id']=1007,['Groups']=0,['Roll']=0,['MetaData']={['title']='Schlaufünkchen',['message']='Es war einmal ein daedrischer Prinz, der war in ganz Tamriel bekannt für sein Wissen. Kein Geheimnis konnte seinen Augen entgehen, keine Information sich vor ihm verstecken. In seinem Übermut war es für ihn undenkbar, etwas nicht zu wissen. \\n\\nNagte dann doch der Zweifel an ihm, so starrte er mit riesigen Augen in seinen Spiegel der Möglichkeiten, bangte:\\n\\n\"Spiegel - zu wissen ich begehre, wer ist der Wissendste in dieser Sphäre?\"\\n\\nStets verkündete der Spiegel: \"Hermaeus Mora, ihr seid der Wissendste hier.\" Da war er zufrieden, denn er wusste, dass der Spiegel die Wahrheit sagte.\\n\\nEines plötzlichen Tages verfiel der Spiegel auf Hermaeus\\' Fragen in tiefes Schweigen. Unruhige Blitze zuckten über seine Oberfläche, er zögerte:\\n\\n\"Ihr, mein Fürst, seid der Wissendste hier. Doch Schlaufünkchen hinter der großen Leere ist noch tausendmal wissender als ihr.\" Da grollte der Prinz wutentbrannt, schleuderte Bücher durch die Luft, klatschte Regale an die Wände.\\n\\n\"Zeig sie mir!\", donnerte der Prinz. Der Spiegel bebte vor Angst, doch er blieb getrübt. Viel konnte er als einfacher Spiegel nicht bewirken, doch das Gleichgewicht der Möglichkeiten musste geschützt werden.\\n\\nSo verbarg der Spiegel Schlaufünkchen aus Verzweiflung hinter einer kristallenen Barriere, wohlwissend, dass dies das Ende seiner eigenen Existenz bedeuten würde. Die zahlreichen garstigen Augen des Prinzen wurden geblendet, keine Tentakel konnte nach Schlaufünkchen greifen. Egal wie sehr sich Hermaeus mühte, stets konnte er nur einen kurzen Blick auf ihr Wissen erhaschen. \\n\\nFortan verabscheute Hermaeus Mora seinen Spiegel und schmetterte ihn in Einzelteilen in alle Himmelsrichtungen fort. Erst viele Jahre später sollte er von findigen Abenteurern erneut zusammengesetzt werden.\\n',},['Yaw']=2.481858,['EffectType']=8503,},[4]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=112145.275424,['Alpha']=1,['Pitch']=0,['X']=73741.246190,['Contrast']=1,['Y']=51816,['SizeX']=26.456456,['Id']=1008,['Groups']=0,['Roll']=0,['MetaData']={['title']='Bright Ember',['message']='Once upon a time there was a Daedric prince who was known throughout Tamriel for his knowledge. No secret could escape his eyes, no information could hide from him. In his arrogance, it was unthinkable for him to be unaware of something.\\n\\nIf doubt did gnaw at him, he stared into his mirror of possibilities with huge eyes and asked timidly:\\n\\n\"Mirror - make it clear, who is the most knowledgeable in this sphere?\"\\n\\nThe mirror always announced: \"Hermaeus Mora, you are the most knowledgeable here.\" He was satisfied, because he knew that the mirror was telling the truth.\\n\\nOne sudden day, the mirror fell into deep silence in response to Hermaeus\\' questions. It hesitated:\\n\\n\"You, my prince, are the most knowledgeable here. But Bright Ember, so I fear, is a thousand times more knowledgeable than you, that seems to be clear.\" The prince growled angrily, threw books and slammed shelves against the walls.\\n\\n\"Show me!\" thundered the prince. The mirror trembled with fear, but it remained clouded. It couldn\\'t do much as a simple mirror, but the balance of possibilities had to be protected.\\n\\nOut of desperation the mirror hid Bright Ember behind a crystal barrier, knowing full well that this would mean the end of its own existence. The prince\\'s numerous eyes were blinded, no tentacle could get ahold of Bright Ember. No matter how hard Hermaeus tried, he could only catch a tiny glimpse of her knowledge.\\n\\nFrom then on, Hermaeus Mora loathed his mirror with passion and smashed it into several pieces. It wasn\\'t until many years later that it was put together again by resourceful adventurers.\\n',},['Yaw']=2.481858,['EffectType']=8503,},[5]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=108376.685587,['Alpha']=1,['Pitch']=0,['X']=74143.142958,['Contrast']=1,['Y']=52481,['SizeX']=26.456456,['Id']=1009,['Groups']=0,['Roll']=0,['MetaData']={['title']='Basti auf dem Käse',['message']='Es war einmal ein Adelsspross, der meckerte fortwährend. Kein Klang war süß genug in seinen Ohren, kein Schmaus wohl genug für seine Augen. Selbst im weichsten Bett sei jede Feder wie ein Nadelstich. Die besorgten Eltern ließen immer neue Betten anliefern, die sie weit gen Himmel stapelten, doch nichts half. \\n\\nBesonders jedoch hasste der Sprössling Käse. Ein Gramm Käse, so pflegte er zu sagen, stinke schlimmer als eine ganze Güllegrube voller Guardung. Die Köchin litt sehr: \"Liebes Kind, nur ein winziges Stückchen Schmelzkäse in der Karottensuppe, das fällt doch gar nicht weiter auf?\" Doch der Junge blieb unnachgiebig.\\n\\nDa fluchte die Köchin so laut in ihrer Küche, dass es selbst Sheogorath auf seinen zitternden Inseln hören konnte. Onkel Sheo lachte, hatte sich ihm doch das perfekte Dilemma - ein Käsedilemma - aufgetan. Vergnügt flüsterte er der Köchin dunkle Gedanken ein, ließ sie sehen, wie sie den Jungen mit Käse ärgern könne. Den Jungen jedoch ließ er vor Angst in den Nächten aufschrecken, zeigte ihm Trugbilder von Käsewogen, in denen er ertrinken und Käserädern, die ihn erschlagen würden.\\n\\nZufrieden unternahm Sheogorath eine letzte Anstrengung: Er übergab der Köchin ein besonders pralles Käserad. \"Teste diesen ungezogenen Bengel! Einbildung! Alles Einbildung!\" Die Köchin versteckte das Rad weit unter dem riesigen Bettenberg.\\n\\nAls der Junge sich nun zu Nachte bettete, ward er von großen Ängsten geplagt. Der Schweiß ronn ihm die Stirn herab, er schrie und weinte. Als die Köchin die Angstschreie des Kindes hörte, erkannte sie sogleich ihren Fehler und ward von großer Reue geplagt. Sheo jedoch besah sich die Szene mit äußerster Wonne, er hatte soeben eine seiner besten Kreationen - den Schauderkäse - ersonnen.\\n',},['Yaw']=1.490511,['EffectType']=8501,},[6]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=108276.727901,['Alpha']=1,['Pitch']=0,['X']=74146.051750,['Contrast']=1,['Y']=52481,['SizeX']=26.456456,['Id']=1010,['Groups']=0,['Roll']=0,['MetaData']={['title']='Basti and the Cheese',['message']='Once upon a time there was a nobleman\\'s son who complained constantly. No sound was sweet enough to his ears, no feast was pleasant enough for his eyes. Even in the softest bed, every feather felt like a pinprick to him. The worried parents kept ordering him new beds, which they stacked high up towards the sky, but nothing helped.\\n\\nHowever, the offspring particularly hated cheese. A gram of cheese, he used to say, smells worse than a whole manure pit full of Guar dung. The cook shook her head to this: \"Dear child, let me add a tiny piece of melted cheese to the carrot soup, no?\" But the boy remained adamant.\\n\\nInflamed with rage, the cook cursed in her kitchen, and even Sheogorath could hear her. Uncle Sheo laughed, as the perfect dilemma - a cheese dilemma - had presented itself. He happily whispered dark thoughts into the cook\\'s mind, letting her see how she could torture the boy with cheese. Then again, he made the boy wake up at night, showing him waves of cheese in which he would drown.\\n\\nSatisfied, Sheogorath made one last effort: he handed the cook a particularly plump wheel of cheese. \"Test this naughty brat! Imagination! It\\'s all in his imagination!\" The cook hid the wheel far under the huge mountain of beds.\\n\\nAs the boy went to sleep, he was plagued by great fears. Sweat ran down his face, he screamed and cried. When the cook heard the child\\'s cries of fear, she immediately realized her mistake and was filled with great remorse. Sheo, however, watched the scene with utter delight; he had just dreamed up one of his best creations - the shivering cheese.\\n',},['Yaw']=1.490511,['EffectType']=8501,},[7]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=112204.641716,['Alpha']=1,['Pitch']=0,['X']=78587.403904,['Contrast']=1,['Y']=51097,['SizeX']=26.456456,['Id']=1013,['Groups']=0,['Roll']=0,['MetaData']={['title']='Tischlein deck dich, Goldguar und Knüppel aus dem Sack',['message']='Es war einmal ein Gelehrter, der wollte sein Schicksal in die eigene Hand zu nehmen. Viele Jahre arbeitete er in seinem Kämmerlein, bis er sein Werk vollendet hatte: Einen Schlüssel, zwischen vielen möglichen Schicksalen stets zu wählen.\\n\\nSo trat er frei hinaus in die Welt. Eines abends kam er an ein Gasthaus und als er Abendbrot forderte, nickte der Wirt nur traurig: \"Guter Mann, mehr als Stück Brot kann ich nicht entbehren!\"\\n\\nDa dachte der Gelehrte bei sich: Ach hätte mich doch ein anderes Schicksal ereilt und ich säße nun vor einem reich gefülltem Tisch. So rief er: \"Tischlein, deck dich!\" Und sein Schicksal ward verändert und er lebte fortan stets mit vollem Magen.\\n\\nDann kam der Gelehrte in ein Städtchen. Er suchte nach einem Zimmer zum Schlafen, doch seine Taschen waren leer und ihm blieb nichts, als für wenige Goldstücke neben einem Guar im Stroh zu schlafen.\\n\\nDa dachte der Gelehrte: Ach hätt ich alles Gold der Welt. Er rief: \"Bricklebrit!\" [Guarsprech für: Speie Gold, jetzt sofort!] Das Guar gehorchte und der Gelehrte lebte fortan ohne Goldnöte.\\n\\nDoch es dämmerte ihm: Nicht gelenkt hatte er sein Schicksal, sondern zerfasert hatte er es! Was wäre geschehen, wäre er in jener Nacht hungrig geblieben oder hätte neben dem Guar im Stroh geschlafen?\\n\\nDie Ungewissheit ließ ihm keine Ruhe. \"Schicksal,\" rief er, \"ich fordere dich zu einer letzten Schlacht heraus!\" Das Schicksal erschien, mürrisch und müde. Der Gelehrte imaginierte euphorisch einen Knüppel aus seinem Wandersack und zog dem Schicksal einen über. Das Schicksal zuckte nur lethargisch mit den Schultern und sackte zusammen.\\n\\nDer Gelehrte jubelte, endlich war er Meister seines Schicksals. Er hüpfte umher und fiel rückwärts in eine tiefe, schwarze Grube, wo er nie wieder gesehen wurde.\\n',},['Yaw']=5.651376,['EffectType']=8502,},[8]={['Color']=102439,['SizeZ']=30,['SizeY']=30,['Z']=112248.821555,['Alpha']=1,['Pitch']=0,['X']=78652.444557,['Contrast']=1,['Y']=51097,['SizeX']=26.456456,['Id']=1014,['Groups']=0,['Roll']=0,['MetaData']={['title']='Table, set yourself',['message']='Once upon a time there was a scholar who wanted to take his fate into his own hands. He worked in his little room for many years until he had completed his work: a key to always choose between many possible fates.\\n\\nSo he went out into the world. One evening he came to an inn and when he asked for supper, the innkeeper just nodded sadly: \"Good man, I can only offer you a dry piece of bread!\"\\n\\nThe scholar thought to himself: Oh, if only a different fate had befallen me and I was now sitting in front of a richly filled table. So he called out: \"Little table, set yourself!\" And his fate was changed and from then on he always had a full stomach.\\n\\nThen the scholar came to a small town. He looked for a room to sleep in, but his pockets were empty and all he could do was sleep on the ground next to a guar.\\n\\nThe scholar thought: Oh, if only I had all the gold in the world. He shouted, \"Bricklebrit!\" [Guar speak for: Spit gold, now!] The guar obeyed and the scholar never had to worry about gold ever again.\\n\\nBut it dawned on him: he had not directed his fate, but rather he had torn it apart! What would have happened if he had stayed hungry that night or slept next to the guar?\\n\\nThe uncertainty left him no peace. \"Fate,\" he cried, \"I challenge you to a final battle!\" Fate appeared, grumpy and tired. The scholar euphorically imagined a club from his satchel and hit fate hard on the head. Fate just shrugged lethargically and slumped down.\\n\\nThe scholar rejoiced, finally master of his fate. He bounced around and fell backwards into a deep black pit, never to be seen again.',},['Yaw']=5.651376,['EffectType']=8502,},[9]={['Color']=696969,['SizeZ']=235,['SizeY']=235,['Z']=114801.573248,['Alpha']=0,['Pitch']=0,['X']=78259.096755,['Contrast']=3.400000,['Y']=52186,['SizeX']=90,['Id']=1015,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Uuh, eine Geisterbahn! Ob Ihr da wohl wieder mit allen Gliedmaßen herauskommt? Verlorene Arme gibt es im Fundbüro zurück. Gegen Gebühr.',},['Yaw']=0.747001,['EffectType']=5010,},[10]={['Color']=197999,['SizeZ']=235,['SizeY']=235,['Z']=114170.892564,['Alpha']=0,['Pitch']=0,['X']=79695.155712,['Contrast']=1,['Y']=50886,['SizeX']=90,['Id']=1017,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Na hallo, wer seid Ihr denn? Ich hatte schon so lange keine lebenden Besucher mehr. Komm nur hinein, Ihr werdet es mit einer 56,38% Wahrscheinlichkeit überleben. Vielleicht.',},['Yaw']=4.605924,['EffectType']=594,},[11]={['Color']=999999,['SizeZ']=220,['SizeY']=220,['Z']=113954.009425,['Alpha']=0,['Pitch']=0,['X']=81705.811828,['Contrast']=1,['Y']=51663,['SizeX']=90.378378,['Id']=1018,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Hm, normalerweise haben Zutaten selten so viel Spaß.',},['Yaw']=5.441937,['EffectType']=5079,},[12]={['Color']=696969,['SizeZ']=235,['SizeY']=235,['Z']=113865.251877,['Alpha']=0,['Pitch']=0,['X']=71931.934029,['Contrast']=1,['Y']=51969,['SizeX']=90,['Id']=1019,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Na wenn das mal kein Bauchweh gibt.',},['Yaw']=0.333358,['EffectType']=5012,},[13]={['Color']=696969,['SizeZ']=300,['SizeY']=300,['Z']=115050.994666,['Alpha']=0,['Pitch']=0,['X']=70485.949100,['Contrast']=1,['Y']=51983,['SizeX']=130,['Id']=1020,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Willkommen bei Styx Tours, Ihrem kompetenten Reisebegleiter in die Unterwelt. Bitte die Hände im Boot lassen und bei Feuerbällen den Kopf einziehen.',},['Yaw']=2.328269,['EffectType']=5018,},[14]={['Color']=696969,['SizeZ']=275,['SizeY']=275,['Z']=111793.956015,['Alpha']=0,['Pitch']=0,['X']=72615.908298,['Contrast']=1,['Y']=51781,['SizeX']=130,['Id']=1021,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Ah, Hermaeus Mora...  Das alte Tentakeltier konnte ich noch nie leiden. Nix wissen macht doch nix! Oder wollt Ihr wissen, wann ihr mal wieder sterbt? In zwei Minuten zum Beispiel. Oh, das habt Ihr nicht gehört...',},['Yaw']=6.169739,['EffectType']=5014,},[15]={['Color']=696969,['SizeZ']=220,['SizeY']=220,['Z']=112862.360884,['Alpha']=0,['Pitch']=0,['X']=73683.587924,['Contrast']=1,['Y']=50973,['SizeX']=80,['Id']=1022,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Buh!',},['Yaw']=2.867576,['EffectType']=5019,},[16]={['Color']=696969,['SizeZ']=220,['SizeY']=220,['Z']=109288.002669,['Alpha']=0,['Pitch']=0,['X']=74255.100161,['Contrast']=1,['Y']=51093,['SizeX']=80,['Id']=1023,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Der Sand war heute extra körnig. Nur für Euch.',},['Yaw']=5.719444,['EffectType']=5019,},[17]={['Color']=999999,['SizeZ']=260,['SizeY']=260,['Z']=108076.864826,['Alpha']=0,['Pitch']=0,['X']=74462.080419,['Contrast']=1,['Y']=52419,['SizeX']=160,['Id']=1024,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Gut gebettet, hoch gestapelt und trotzdem nur am Jammern. Typisch Adlige.',},['Yaw']=5.663593,['EffectType']=5056,},[18]={['Color']=999999,['SizeZ']=120,['SizeY']=120,['Z']=112155.195752,['Alpha']=0,['Pitch']=0,['X']=77985.421144,['Contrast']=1,['Y']=51228,['SizeX']=234.117647,['Id']=1025,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='So ein höriger Knüppel ist natürlich auch nicht schlecht.',},['Yaw']=3.857178,['EffectType']=5063,},[19]={['Color']=999998,['SizeZ']=260,['SizeY']=260,['Z']=110254.491624,['Alpha']=0,['Pitch']=0,['X']=75262.461641,['Contrast']=1,['Y']=52108,['SizeX']=106.716418,['Id']=1027,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Wer hätte nicht gerne ein magisches Tischlein?',},['Yaw']=2.665118,['EffectType']=5066,},[20]={['Color']=696969,['SizeZ']=300,['SizeY']=300,['Z']=111482.465108,['Alpha']=0,['Pitch']=0,['X']=76731.321241,['Contrast']=1,['Y']=51626,['SizeX']=120,['Id']=1028,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Oder ein, vornehm ausgedrückt, Gold defäkierendes Guar?',},['Yaw']=4.040437,['EffectType']=5016,},[21]={['Color']=990098,['SizeZ']=260,['SizeY']=260,['Z']=114471.557735,['Alpha']=0,['Pitch']=0,['X']=78204.021354,['Contrast']=1,['Y']=50899,['SizeX']=123.664717,['Id']=1029,['Groups']=0,['Roll']=0,['MetaData']={['name']='Kürbisfratze',['message']='Wenn ich das frei übersetze, sagen die Beiden: Winke winke und Gni-hi-hi. Wartet, winken die da mit Eurem Arm? Na, wie auch immer. Ich hoffe ihr hattet Spaß, kommt bald wieder. Ich passe solange auf Euren Arm auf.',},['Yaw']=2.474877,['EffectType']=5074,},},['Version']=1773,['TS']=1698520319,}"
