R["fx__na__@themastermeme__3"]="{['Version']=1773,['TS']=1688311468,['Effects']={[1]={['Yaw']=1.219985,['Id']=1140,['SizeY']=30,['Pitch']=4.712564,['Y']=21046,['SizeZ']=30,['Roll']=0,['Color']=518099,['SizeX']=26.456456,['EffectType']=8501,['MetaData']={['title']='Letter from Mirri',['message']='I was talking with dad, telling him what I\\'ve been up to. It made me realize how much you and I have done since we crossed paths at that shattered doomvault. I think we\\'ve visited half the Daedric shrines and ruins in Tamriel. Not to mention all those dolmen.\\n\\n\\n\\nI want you to have this family heirloom. Traditionally, it\\'s handed down from mother to daughter. My family isn\\'t big on traditions, but we are sentimental. When mom gave it to me, I thought she was reminding me I wasn\\'t getting any younger. But she told me to give it to the right person when I found them. I\\'m not sure what that means, but after all we\\'ve been through, I thought you should have it. As a remembrance of our adventures.',},['Groups']=0,['Alpha']=1,['X']=26983.443153,['Contrast']=2,['Z']=24472.903901,},},}"
R["fx__na__@themastermeme__2"]="{['Version']=1773,['TS']=1688310830,['Effects']={[1]={['SizeY']=30,['Yaw']=1.865757,['Id']=1138,['Y']=20052,['MetaData']={['title']='Letter from Bastian',['message']='We have come a long way, my friend. When we saved my foster-brother Quistley from the Daughter of Sithis, I never imagined where our road would lead. Dark dangers and hard-won victories, mystic Eyevea, even a reunion with a sister I thought long dead. Through it all you have been the truest comrade I could ask for.\\n\\n\\n\\n\\n\\nI have never been good at talking about such things, so let me simply thank you with a token of our friendship. My old tutor Thierren gave me this medalion when I earned my staff. It depicts Julianos, patron of mages. I have always regarded him as my protector, and I hope he will watch over you as well. In years to come, let it remind you of our journeys together.',},['Z']=27056.128074,['Contrast']=2,['Roll']=0,['Groups']=0,['Color']=436682,['Alpha']=1,['X']=22193.501291,['Pitch']=4.712564,['SizeZ']=30,['EffectType']=8501,['SizeX']=26.456456,},},}"
