R["oh__@all-star_trainman"]="{['TS']=1687913817,['na']={[48]={['N']='Falkreath Sanctuary',['O']=19483,['C']=1.023000,['D']='                                             †    ← A dagger?\\n                    a heart! →      <3\\nW h a t        i s   t h e   ♪m u s i c♪   o f   l i f e ?\\n  ↑ \"Um... the lute? No, drums!\"\\n       ↑ \" Screaming?\"\\n           ↑\"Some kind of choir. With... chanting!\"\\n...\\n.... .... Silence, my brother.\\n« W E ∟ C O M E      H O M E »',},[10]={['N']='Unhumblemud',['O']=19536,['C']=1.021000,['D']='When traditional meets contemporary.\\nWhen modesty meets vanity.\\nDespite complaints from the Dhalmora town folks, this ridiculous outdoor complex stands tall and unhumbled.\\nStarted from the bottom, now we\\'re here.\\nCome to the garden, flex and relax with friends.',},},['Version']=1773,['Key']='oh__@all-star_trainman',}"
