R["oh__@tiwborn"]="{['na']={[8]={['D']='Ezabi has opened \"Some Stuffy Vault\" in Marbruk with the wealth she has earned holding your sharp-clawed treasures, your dull-clawed ones too.',['O']=19316,['C']=1.039000,['N']=' Some Stuffy Vault',},[37]={['D']='',['O']=19056,['C']=1.010000,['N']='Hidden Moon Manor',},[75]={['D']='An Orsimer Stronghold belonging to Ghrasharog, he is a huge fan of Tales of Tribute and has established the Forgemaster Falls Gaming Hall in his Stronghold. He is a mighty Chief in search of wives!',['O']=19270,['C']=1.041000,['N']=' ToT Gaming Hall',},[28]={['D']='Visit this spooktacular witch\\'s cottage at your own peril, five-claw! The sights are worth it, but this one must warn you, this one has been bound inside after being discovered by the witch.',['O']=18917,['C']=1.022000,['N']='Witch\\'s Cottage',},[69]={['D']='The Abbey of the Hidden Moon serves as the adaptorium for the Order of the same name, called Lofoki Kha\\'jay in Ta\\'agra. The Order of the Hidden Moon is dedicated to using necromancy to redeem the souls of Dro\\'m\\'athra through service to their true-spirited kin, as taught to our Order by Azurah. \\n\\n\\nPlease find rest and comfort in our humble abbey, and stop by the bazaar.',['O']=19259,['C']=1.037000,['N']='HiddenMoonAdeptorium',},[70]={['D']='Functional Library, feel free to read, just keep Sereyne\\'s wine away from the books please.',['O']=18924,['C']=1.011000,['N']='Rimmen Temple',},[48]={['D']='The Icereach Coven was left in shambles after the Grey Host was defeated, without their allies they have retreated to Falkreath Hold and seized the Jarl\\'s Country restreat to serve as their base of operations while they rebuild. Can the Undaunted enter the estate through the old crypts and defeat them for good?',['C']=1.500000,['O']=19487,['N']=' Icereach\\'s Retreat',},},['Version']=1773,['TS']=1683695041,['Key']='oh__@tiwborn',}"
