R["oh__@bonitabrujah"]="{['na']={[56]={['N']='Tal\\'Mahe\\'Ra',['D']='This underground complex serves as the main headquarters for the Tal\\'Mahe\\'Ra (Black Hand). Intell that has been gather is shared with members and assignments are both briefed and debriefed here. This place also serves as a safe haven for those in this secret orginization. Skills of all manner can be honed here at the provided crafting area. Treasures and trophies of members exploits are proudly put on display. Tal\\'Mahe\\'Ra consider each member part of its family, family takes care of their own. ',['C']=1.007000,['O']=19336,},[81]={['N']='The Inn & Out Tavern',['D']='Located in the foothills just North of the Southern Mountains lies a large rustic lodge. The Inn & Out Tavern offers not only food and drink but has several rooms and a large bath for those needing to wash off the road dust and rest before venturing out into Western Skyrim. This unquie location offers visitors a chance to relax and enjoy a bit of warmth in an otherwise cold and hostile area. So stop by and enjoy a meal or perhaps just relax in one of the rooms after a hot bath. All are welcome!',['C']=1.500000,['O']=19302,},[87]={['N']='Leyawiin Inn',['D']='This rooms serves as an office of operations for the Black Hand (Tal\\'Mahe\\'Ra) in the Blackwood region. Located in the Pilgrim\\'s Rest it allows members to watch the comings and goings of those in Leyawiin and outlying areas. This base of operations is so members either get new assignments or brief others on their current ones. This space also allows for dealing with those that are less than cooperative. So please forgive the mess as this is a work enviroment. ',['C']=1.007000,['O']=19336,},[76]={['N']='The Hidden Gem',['D']='This location that\\'s tucked back into a cayon that has a pristine waterfall of sapphire blue water. Long ago the dead of the Ra Gada were laid to rest in the surrounding cliff facings. This place has long been forgotten by most and because of that, it is the perfect place for those that wish to remain unnoticed. Here deals and negotiations can be worked out, while also offering guests a place to relax and enjoy the beauty of the oasis. Come and see the alure of this \"Hidden Gem\". ',['C']=1.500000,['O']=19392,},[49]={['N']='Casa Brujah',['O']=19294,},[38]={['N']='Shipping & Trade HQ',['D']='Features a large dock for both merchant and fishing fleet. House is used for both social gatherings as well as planning and business meetings. Not all business is cordial and those deemed unfriendly find themselves as guests in the lower part of the fortress. ',['C']=1.500000,['O']=19316,},[71]={['N']='Elsweyr Meadow',['D']='Welcome to Tal\\'Mahe\\'Ra\\'s open air market. Here you can find a little of this and a little of that. Perhaps some food or maybe that rare arcane item, maybe even some ancient relic long forgotten. There\\'s even a couple of nice beaches to just lounge about or maybe visit the large beer garden. Who knows what you might find as you wander about the area. Enjoy! ',['C']=1.500000,['O']=19445,},},['Version']=1773,['TS']=1680068068,['Key']='oh__@bonitabrujah',}"
