R["oh__@xf3nnx"]="{['na']={[56]={['O']=19401,['D']='This old Brotherhood sanctuary has been excavated by smugglers looking to connect some underground routes for discretely moving illicit goods.   As a result, some strange artifacts along with a mysterious ancient vault have been  uncovered, though to find them you\\'ll have to know where to look.  Follow the banekin if you get stuck!',['N']='Silversong\\'s Vault',['C']=1.026000,},[47]={['C']=1.029000,['D']='Silversong is said to be a master metal smith, occultist and daedric scholar and somewhere in the realm of Coldharbour is a forge brought forth from twisted stone, blackened steel and corrupted sorcery. This forge was built by Silversong to help him create his specific, 4-wheel maglocked impenetrable relic vaults for discrete customers in Nirn and in Oblivion beyond.\\n\\n(this is the location that follows my other home, \"Silversong\\'s Vault\")',['N']='Vault-Master\\'s Forge',['O']=19401,},},['Key']='oh__@xf3nnx',['Version']=1771,['TS']=1676258107,}"
