R["oh__@ladyazura"]="{['Version']=1771,['Key']='oh__@ladyazura',['na']={[80]={['O']=19353,['C']=1.026000,['N']='Mzungthand Ruins',['D']='Mzungthand Ruins is an entirely custom built Dwemer Ruin. It seems it was used for Blackreach research, with a few samples, a library, a forge, an observatory, and unfortunately it looks like the rest of the ruins have collapsed and are frozen in the ice.',},[49]={['O']=19272,['C']=1.023000,['N']='Accursed Forest',['D']='Spooky Halloween inspired witch hut deep in the woods.',},[70]={['O']=19084,['C']=1.026000,['N']='Ayleid Ruin',['D']='Ayleid Ruin house inspired by The Elder Scrolls 4: Oblivion.',},[56]={['O']=19190,['C']=1.026000,['N']='Anyammis Nagasel',['D']='Hidden away deep in this cave is an Ayleid Ruin- Anyammis Nagasel. Complete with a secret garden and magical pools. This Ayleid Ruin has mostly collapsed in on itself, but there is still some areas to be explored...',},[26]={['O']=19114,['C']=1.007000,['N']='Cyrodiilic Retreat',['D']='A small Imperial themed getaway, with a bar and banquet table. Upstairs is a small reading nook within the library, and the bedroom is cozy with an extra large bed, sure to suit anyone\\'s needs.',},[43]={['O']=19084,['C']=1.026000,['N']='Morrowind House',['D']='Inspired by The Elder Scrolls 3: Morrowind. Inspiration drawn from the aesthetic/style of Hlaalu houses in the Balmora area, as well as the Hla Oad stronghold.',},[44]={['O']=19281,['C']=1.041000,['N']='Ald-Velothi Outpost',['D']='Ald-Velothi Outpost is a small Redoran outpost with all of your basic ammenities. There is housing in the exterior, and a tavern, blacksmith, mage, and Temple for all good Dunmer to pray and worship at. There is also beds for rent.',},[61]={['O']=19291,['C']=1.037000,['N']='Chapel Murders',['D']='Imperial Chapel and cemetery that has been lost to Tamriel for an unknown period of time with a potential dark secret....',},[88]={['O']=19171,['C']=1.037000,['N']='Azura Shrine',['D']='A shrine to Azura hidden away in a cave, with an underground river and small library for worshippers. (THIS HOUSE IS BEST EXPERIENCED IN FIRST PERSON)',},[86]={['O']=19084,['C']=1.026000,['N']='Ayleid Ruins',['D']='Ayleid Ruins inspired by those seen in The Elder Scrolls: 4 Oblivion.',},},['TS']=1672108368,}"
